import React from 'react';
import { Container } from 'react-bootstrap';

const CTHero = () => {
  return (
    <Container fluid className="p-0">
      <img
        src="https://churchgate.com/wp-content/uploads/2022/12/New-Project-1-15-1300x650.jpg"
        alt="Churchgate Hero"
        className="img-fluid w-100"
        style={{ objectFit: 'cover', height: '60vh' }}
      />
    </Container>
  );
};

export default CTHero;
